CREATE TABLE [Process].[Tbl_Deuda](
	[id] [bigint] IDENTITY(1,1) NOT NULL,
	[numero_documento] [varchar](20) NOT NULL,
	[glosa] [varchar](20) NULL,
	[llave_principal] [varchar](14) NOT NULL,
	[dni] [varchar](8) NULL,
	[ruc] [varchar](11) NULL,
	[llave_alterna] [varchar](16) NULL,
	[fecha_vencimiento] [datetime] NOT NULL,
	[fecha_emision] [datetime] NOT NULL,
	[saldo] [numeric](12, 2) NULL,
	[importe_bruto] [numeric](12, 2) NOT NULL,
	[mora] [numeric](12, 2) NOT NULL,
	[gasto_administrativo] [numeric](12, 2) NOT NULL,
	[importe_minimo] [numeric](12, 2) NOT NULL,
	[nombre_cliente] [varchar](30) NOT NULL,
	[servicio] [varchar](10) NOT NULL,
	[moneda] [char](1) NOT NULL,
	[periodo] [varchar](2) NOT NULL,
	[cuota] [varchar](2) NOT NULL,
	[anio] [varchar](4) NOT NULL,
	[id_empresa] [varchar](3) NOT NULL,
	[estado] [char](1) NOT NULL,
	[key_lp]  AS (case when nullif(upper(case when patindex('%[^0]%',ltrim(rtrim([llave_principal])))=(0) then '' else substring(ltrim(rtrim([llave_principal])),patindex('%[^0]%',ltrim(rtrim([llave_principal]))),len(ltrim(rtrim([llave_principal])))) end),'') IS NOT NULL then concat(upper(ltrim(rtrim([id_empresa]))),':',upper(ltrim(rtrim([servicio]))),':0:',upper(substring(ltrim(rtrim([llave_principal])),patindex('%[^0]%',ltrim(rtrim([llave_principal]))),len(ltrim(rtrim([llave_principal]))))))  end) PERSISTED,
	[llave_canonica]  AS (CONVERT([varchar](400),concat_ws('|',upper(ltrim(rtrim([id_empresa]))),upper(ltrim(rtrim([servicio]))),upper(ltrim(rtrim([numero_documento]))),nullif(upper(ltrim(rtrim([dni]))),''),nullif(upper(ltrim(rtrim([ruc]))),''),nullif(upper(ltrim(rtrim([llave_principal]))),''),nullif(upper(ltrim(rtrim([llave_alterna]))),'')))) PERSISTED,
	[llave_hash]  AS (CONVERT([binary](32),hashbytes('SHA2_256',CONVERT([varbinary](8000),CONVERT([varchar](400),concat_ws('|',upper(ltrim(rtrim([id_empresa]))),upper(ltrim(rtrim([servicio]))),upper(ltrim(rtrim([numero_documento]))),nullif(upper(ltrim(rtrim([dni]))),''),nullif(upper(ltrim(rtrim([ruc]))),''),nullif(upper(ltrim(rtrim([llave_principal]))),''),nullif(upper(ltrim(rtrim([llave_alterna]))),''))))))) PERSISTED,
	[key_ruc]  AS (case when ltrim(rtrim([ruc]))<>'' AND TRY_CAST(ltrim(rtrim([ruc])) AS [bigint]) IS NOT NULL then concat(upper(ltrim(rtrim([id_empresa]))),':',upper(ltrim(rtrim([servicio]))),':2:',TRY_CAST(ltrim(rtrim([ruc])) AS [bigint]))  end) PERSISTED,
	[key_dni]  AS (case when ltrim(rtrim([dni]))<>'' AND TRY_CAST(ltrim(rtrim([dni])) AS [bigint]) IS NOT NULL then concat(upper(ltrim(rtrim([id_empresa]))),':',upper(ltrim(rtrim([servicio]))),':1:',TRY_CAST(ltrim(rtrim([dni])) AS [bigint]))  end) PERSISTED,
	[key_la]  AS (case when nullif(ltrim(rtrim(case when patindex('%[^0]%',ltrim(rtrim([llave_alterna])))=(0) OR ltrim(rtrim([llave_alterna]))='' then '' else substring(ltrim(rtrim([llave_alterna])),patindex('%[^0]%',ltrim(rtrim([llave_alterna]))),len(ltrim(rtrim([llave_alterna])))) end)),'') IS NULL then NULL else concat(upper(ltrim(rtrim([id_empresa]))),':',upper(ltrim(rtrim([servicio]))),':3:',upper(substring(ltrim(rtrim([llave_alterna])),patindex('%[^0]%',ltrim(rtrim([llave_alterna]))),len(ltrim(rtrim([llave_alterna])))))) end) PERSISTED,
 CONSTRAINT [PK_Tbl_Deuda] PRIMARY KEY CLUSTERED 
(
	[id] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON, OPTIMIZE_FOR_SEQUENTIAL_KEY = OFF) ON [PRIMARY]
) ON [PRIMARY]
