/****** Object:  StoredProcedure [Process].[Usp_Actualizar_Deuda_En_Carga]    Script Date: 16/09/2025 00:31:35 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [Process].[Usp_Actualizar_Deuda_En_Carga]
  @p_llave_hash binary(32),
  @p_fecha_emision datetime,
  @p_fecha_vencimiento datetime,
  @p_saldo numeric(12, 2),
  @p_importe_bruto numeric(12, 2),
  @p_mora numeric(12, 2),
  @p_gasto_administrativo numeric(12, 2),
  @p_importe_minimo numeric(12, 2),
  @p_periodo varchar(2),
  @p_cuota varchar(2),
  @p_anio varchar(4),
  @p_moneda char(1)
AS
BEGIN
    SET NOCOUNT ON;

    IF NOT EXISTS (
        SELECT 1
        FROM Process.Tbl_Deuda
        WHERE llave_hash = @p_llave_hash
          AND estado = 'P'
    )
    BEGIN
        ;THROW 50002, 'No existe registro con estado P para actualizar.', 1;
    END;

    UPDATE Process.Tbl_Deuda
    SET fecha_emision     = @p_fecha_emision,
        fecha_vencimiento = @p_fecha_vencimiento,
		saldo             = @p_saldo,
        importe_bruto     = @p_importe_bruto,
        mora              = @p_mora,
        gasto_administrativo = @p_gasto_administrativo,
        importe_minimo    = @p_importe_minimo,
        periodo           = @p_periodo,
        cuota             = @p_cuota,
        anio              = @p_anio,
        moneda            = @p_moneda
    WHERE llave_hash = @p_llave_hash
      AND estado = 'P';
END;
GO
