CREATE PROCEDURE [Process].[Usp_Insertar_Deuda]
@p_numero_documento varchar(20),
@p_glosa varchar(20),
@p_llave_principal varchar(14),
@p_dni varchar(8),
@p_ruc varchar(11),
@p_llave_alterna varchar(14),
@p_fecha_vencimiento datetime,
@p_fecha_emision datetime,
@p_saldo numeric(12, 2),
@p_importe_bruto numeric(12, 2),
@p_mora numeric(12, 2),
@p_gasto_administrativo numeric(12, 2),
@p_importe_minimo numeric(12, 2),
@p_nombre_cliente varchar(30),
@p_servicio varchar(10),
@p_moneda char(1),
@p_periodo varchar(2),
@p_cuota varchar(2),
@p_anio varchar(4),
@p_id_empresa varchar(3),
@p_estado char(1)
AS
BEGIN
	INSERT INTO Process.Tbl_Deuda
	VALUES (@p_numero_documento, @p_glosa, @p_llave_principal, @p_dni, @p_ruc, @p_llave_alterna, @p_fecha_vencimiento, 
			@p_fecha_emision, @p_saldo, @p_importe_bruto, @p_mora, @p_gasto_administrativo, @p_importe_minimo,
			@p_nombre_cliente, @p_servicio, @p_moneda, @p_periodo, @p_cuota, @p_anio, @p_id_empresa, @p_estado)
END
GO
