CREATE PROCEDURE [Transac].[Usp_Actualizar_estado_transaccion_por_empresa]
@p_empresa varchar(3),
@p_ids_ok varchar(max),
@p_estado char(1)
AS
BEGIN
UPDATE T
SET estado_notificacion = @p_estado
FROM Transac.Tbl_Transaccion T
INNER JOIN STRING_SPLIT(@p_ids_ok, ',') S
  ON T.id = TRY_CAST(S.value AS bigint)
WHERE T.id_empresa = @p_empresa;
