CREATE PROCEDURE [Transac].[Usp_Insertar_Reversa]
    @p_fecha_hora_transaccion datetime,
    @p_id_banco varchar(4),
    @p_id_consulta varchar(16),
    @p_numero_operacion varchar(12),
    @p_numero_documento varchar(16),
    @p_id_empresa varchar(3),
    @p_servicio varchar(5),
    @p_tipo_transac char(1),
    @p_voucher varchar(50),
	@p_estado_notificacion char(1),
    @p_id_transaccion bigint output,
	@p_nombre_cliente varchar(30) output
AS
BEGIN 
SET NOCOUNT ON;

    BEGIN TRY
        BEGIN TRANSACTION;

		DECLARE @importe_revertido numeric(12,2);
		DECLARE @moneda char(1);
		DECLARE @canal varchar(2);
		DECLARE @forma varchar(2);
		DECLARE @id_deuda_ref BIGINT;
		DECLARE @cuenta_banco varchar(50);

		SELECT TOP 1
				@importe_revertido = importe_pagado,
				@moneda = moneda,
				@canal = id_canal_pago,
				@forma = id_forma_pago,
				@id_deuda_ref = id_deuda_ref,
				@cuenta_banco = cuenta_banco,
				@p_nombre_cliente = nombre_cliente
            FROM [Transac].[Tbl_Transaccion] T
            WHERE numero_operacion   = @p_numero_operacion
				  AND numero_documento   = @p_numero_documento
				  AND id_banco           = @p_id_banco
				  AND servicio           = @p_servicio
				  AND id_empresa         = @p_id_empresa
				  AND tipo_transac		 = 'P'
			ORDER BY T.id DESC
			IF @importe_revertido IS NULL
				BEGIN
					RAISERROR('No se encontro transaccion original para reversa.', 16, 1);
					ROLLBACK TRANSACTION;
					RETURN;
				END
		INSERT INTO [Transac].[Tbl_Transaccion] (
            fecha_hora_transaccion,
            id_canal_pago,
            id_forma_pago,
            numero_operacion,
            id_consulta,
            servicio,
            numero_documento,
            importe_pagado,
            moneda,
            id_empresa,
            tipo_transac,
            id_banco,
            voucher,
            cuenta_banco,
            id_deuda_ref, 
			nombre_cliente,
			estado_notificacion
        )
        VALUES (
            @p_fecha_hora_transaccion,
            @canal,               -- canal pago (ajusta segn corresponda)
            @forma,               -- forma pago (ajusta segn corresponda)
            @p_numero_operacion,
            @p_id_consulta,
            @p_servicio,
            @p_numero_documento,
            @importe_revertido, -- importe revertido
            @moneda,                -- moneda (ajusta segn corresponda)
            @p_id_empresa,
            @p_tipo_transac,    -- 'R' para reversa
            @p_id_banco,
            @p_voucher,
            @cuenta_banco,
            @id_deuda_ref,                  -- id_deuda_ref (ajusta si debe referenciar algo)
			@p_nombre_cliente,
			@p_estado_notificacion
        );
		SET @p_id_transaccion = SCOPE_IDENTITY();
		UPDATE [Process].[Tbl_Deuda]
        SET saldo = saldo + @importe_revertido,
            estado = 'P'
        WHERE id_empresa       = @p_id_empresa
          AND servicio         = @p_servicio
          AND numero_documento = @p_numero_documento;
		  COMMIT TRANSACTION;
    END TRY
    BEGIN CATCH
        IF @@TRANCOUNT > 0
            ROLLBACK TRANSACTION;

        DECLARE @ErrorMessage NVARCHAR(4000) = ERROR_MESSAGE();
        RAISERROR(@ErrorMessage, 16, 1);
    END CATCH
END
GO
/****** Object:  StoredProcedure [Transac].[Usp_Listar_Deudas_Por_Llave]    Script Date: 16/09/2025 00:31:35 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [Transac].[Usp_Listar_Deudas_Por_Llave]
    @empresa  VARCHAR(10),
    @servicio VARCHAR(10),
    @llave    VARCHAR(14),
	@estado CHAR(1)
AS
BEGIN
    SET NOCOUNT ON;
    WITH Y AS (
        SELECT *
        FROM Process.Tbl_Deuda
        WHERE key_lp = CONCAT(@empresa, ':', @servicio, ':0:', @llave)
		AND (@estado = 'E' OR estado = @estado)
        UNION ALL
        SELECT *
        FROM Process.Tbl_Deuda
        WHERE key_dni = CONCAT(@empresa, ':', @servicio, ':1:', @llave)
		AND (@estado = 'E' OR estado = @estado)
        UNION ALL
        SELECT *
        FROM Process.Tbl_Deuda
        WHERE key_ruc = CONCAT(@empresa, ':', @servicio, ':2:', @llave)
		AND (@estado = 'E' OR estado = @estado)
        UNION ALL
        SELECT *
        FROM Process.Tbl_Deuda
        WHERE key_la = CONCAT(@empresa, ':', @servicio, ':3:', @llave)
		AND (@estado = 'E' OR estado = @estado)
    )
    SELECT id, numero_documento, llave_principal, dni, ruc, llave_alterna,
           fecha_emision, fecha_vencimiento, saldo, importe_bruto, mora,
           gasto_administrativo, importe_minimo, nombre_cliente, servicio,
           moneda, periodo, cuota, anio, id_empresa, estado, glosa
    FROM Y
    GROUP BY id, numero_documento, llave_principal, dni, ruc, llave_alterna,
             fecha_emision, fecha_vencimiento, saldo, importe_bruto, mora,
             gasto_administrativo, importe_minimo, nombre_cliente, servicio,
             moneda, periodo, cuota, anio, id_empresa, estado, glosa
	ORDER BY fecha_vencimiento, id;
END

