@p_estado CHAR(1)
AS
SELECT T.id,
	T.fecha_hora_transaccion,
	T.id_canal_pago,
	T.id_forma_pago,
	T.numero_operacion,
	T.id_consulta,
	T.servicio,
	T.numero_documento,
	T.importe_pagado,
	T.moneda,
	T.id_empresa,
	T.tipo_transac,
	T.id_banco,
	T.voucher,
	T.cuenta_banco,
	T.id_deuda_ref,
	T.nombre_cliente,
	T.estado_notificacion
FROM Transac.Tbl_Transaccion T
WHERE (@p_estado = 'E' OR T.estado_notificacion = @p_estado)
AND id_empresa = @p_empresa
